V.a.W. Hillier, &quot;Hilliers Fundamentals/Motor Vehicle Tech, 5th edition (Book 3)&quot;

Nelson Thornes | 2007 | ISBN: 0748784357 | 272 pages | PDF 

Hillier's famous series of Motor Vehicle Technology texts have been completely revised and updated. Endorsed by the IMI, these three texts are an excellent resource for apprentices as well as trained professionals
